"""我们称一个分割整数数组的方案是 好的 ，当它满足：

数组被分成三个 非空 连续子数组，从左至右分别命名为 left ， mid ， right 。
left 中元素和小于等于 mid 中元素和，mid 中元素和小于等于 right 中元素和。
给你一个 非负 整数数组 nums ，请你返回 好的 分割 nums 方案数目。由于答案可能会很大，请你将结果对 109 + 7 取余后返回。

 

示例 1：

输入：nums = [1,1,1]
输出：1
解释：唯一一种好的分割方案是将 nums 分成 [1] [1] [1] 。
示例 2：

输入：nums = [1,2,2,2,5,0]
输出：3
解释：nums 总共有 3 种好的分割方案：
[1] [2] [2,2,5,0]
[1] [2,2] [2,5,0]
[1,2] [2,2] [5,0]
示例 3：

输入：nums = [3,2,1]
输出：0
解释：没有好的分割方案。
 

提示：

3 <= nums.length <= 105
0 <= nums[i] <= 104

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/ways-to-split-array-into-three-subarrays
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
"""
from leetcode_python.utils import *


def sum_nums一维前缀和(nums):
    res = []
    for n in nums:
        res.append(n + res[-1] if res else n)
    return res

class Solution:
    def waysToSplit(self, nums: List[int]) -> int:
        sums = sum_nums一维前缀和(nums)
        S = sums[-1]
        res = 0
        # print(nums)
        # print(sums)
        l=len(nums)
        for i in range(min(l-2,bisect.bisect_right(sums,S//3))):
            S1 = sums[i]
            j_min = max(i+1,bisect.bisect_left(sums,2*S1))
            j_max = min(l-1,bisect.bisect_right(sums,S1+(S-S1)/2))
            res+=j_max-j_min
            res%=10**9+7
        #     print(i,S1,j_min,j_max)
        # print(len(nums))
        return res



def test(data_test):
    s = Solution()
    data = data_test    # normal
    # data = [List2Node(data_test[0])]  # list转node
    return s.waysToSplit(*data)

def test_obj(data_test):
    result = [None]
    obj = Solution(*data_test[1][0])
    for fun,data in zip(data_test[0][1::],data_test[1][1::]):
        if data:
            res = obj.__getattribute__(fun)(*data)
        else:
            res = obj.__getattribute__(fun)()
        result.append(res)
    return result

